import React from "react";
import Wrapper from '../components/Header/Wrapper';
import styled from 'styled-components';

import KaneLogo from "../components/KaneLogo/KaneLogo";

import Seek7 from "../components/Room/UploadPhotosToWeb/seek/Seek-1-7.png"
import Seek3 from "../components/Room/UploadPhotosToWeb/seek/Seek-1-3.png"
import Seek5 from "../components/Room/UploadPhotosToWeb/seek/Seek-1-5.png"
import Seek2 from "../components/Room/UploadPhotosToWeb/seek/Seek-1-2.png"
import Seek1 from "../components/Room/UploadPhotosToWeb/seek/Seek-1-1.png"
import Seek4 from "../components/Room/UploadPhotosToWeb/seek/Seek-1-4.png"
import Seek6 from "../components/Room/UploadPhotosToWeb/seek/Seek-1-6.png"




// const LandingPageStyled = styled.div;

const LandingPage=() => {
    // Init
    const container = document.getElementById('seekLogoContainer');
    const inner = document.getElementsByClassName('inner')

    // Mouse
    let mouse = {
        _x: 0,
        _y: 0,
        x: 0,
        y: 0,
        updatePosition: function(event) {
            var e = event || window.event;
            this.x = e.clientX - this._x;
            this.y = (e.clientY - this._y) * -1;
        },
        setOrigin: function(e) {
            this._x = e.offsetLeft + Math.floor(e.offsetWidth/2);
            this._y = e.offsetTop + Math.floor(e.offsetHeight/2);
        },
        show: function() { return `(`+ this.x + `,` + this.y `)`;}
    }
    // Track the mouse position to the center of the container.
    mouse.setOrigin(container);


    let counter = 0
    let updateRate = 10;
    const isTimeToUpdate = () => {
        return counter++ % updateRate === 0;
    };

    const onMouseEnterHandler = (event) => {
        update(event);
        console.log(updateRate)
    }


    const onMouseLeaveHandler = () => {
        inner.style = "";
    }
    const onMouseMoveHandler = (event) => {
        if(isTimeToUpdate()) {
            update(event);
        }
    }

    container.onmouseenter = onMouseEnterHandler;
    container.onmouseleave = onMouseLeaveHandler;
    container.onmousemove = onMouseMoveHandler;


    return(
        <section id="landingPage">
            <Wrapper>
                <div className="citeArrival">
                    <div className="lizKaneIntro">
                        <p id="Liz" className="myName">
                            Liz Kane
                        </p>
                        <p id="p1">Moralistically Driven that Everything Should Have a Purpose.</p>
                        <p id="p2">Realistically Optimistic</p>
                        <p id="p3">Direct & Patient in Leading Conflict Resolution.</p>
                        <p id="p4">Gifted in Creating Communities.</p>



                    </div>  

                    <div id="seekLogoContainer">
                        <img src={Seek3} alt="seek logo layer" id="seekPhoto13" className="seekLogo inner"></img>
                        <img src={Seek5} alt="seek logo layer" id="seekPhoto15" className="seekLogo inner"></img>
                        <img src={Seek2} alt="seek logo layer" id="seekPhoto17" className="seekLogo inner"></img>
                        <img src={Seek1} alt="seek logo layer" id="seekPhoto19" className="seekLogo inner"></img>
                        <img src={Seek4} alt="seek logo layer" id="seekPhoto21" className="seekLogo inner"></img>
                        <img src={Seek6} alt="seek logo layer" id="seekPhoto23" className="seekLogo inner"></img>
                    </div>

                </div>
                {/* <KaneLogo/> */}
            </Wrapper>
        </section>
    )
}

export default LandingPage;
